const moduleIcons = (clientModules?.reduce(
  (icons, module) =>
    'icons' in module && module.icons ? {...icons, ...module.icons} : icons,
  {},
) ?? {}) as MergeIconNames<(typeof clientModules)[number]['icons']>

type MergeIconNames<T extends object | undefined | void> = {
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  [k in T extends any ? keyof T : never]: Partial<
    Record<SvgIconVariant, SvgIconConfig>
  >
}

export const SvgIconsConfig = {
  ...SystemSvgIcons,
  ...DesignSystemSvgIcons,
  ...moduleIcons,
} satisfies SvgIconVariantConfig

export type BaseSvgIconName = keyof typeof SvgIconsConfig

export const FILLED_SUFFIX = '_filled'
export type SvgIconName =
  | BaseSvgIconName
  | `${BaseSvgIconName}${typeof FILLED_SUFFIX}`
